Sprint Boot 2.0 Applications (Reactive MongoDB) hangs up on startup<p>I'm new to Spring Data with Reactive MongoDB and am having troubles with my <a href="https://github.com/phip123/reactive-hangs/blob/master/src/main/java/com/example/reactivehangs/Generator.java" rel="nofollow noreferrer">generator</a>. Both setup methods won't return. The first one is</p>

<pre><code>@PostConstruct
public void setup() {
    personRepository.deleteAll().block();
    LOG.info("Never happens");
}
</code></pre>

<p>The deleteAll() call will block indefinitely.  I'm experiencing the same problem when executing this</p>

<pre><code>@PostConstruct
public void setup2() {
  List&lt;Person&gt; personList = new LinkedList&lt;&gt;();
    for (int i = 0; i &lt; 200; i++) {
        personList.add(Person.PersonBuilder.aPerson().uuid(UUID.randomUUID()).name("Name " + i).build());
    }

    personRepository.saveAll(personList).blockLast();
}
</code></pre>

<p>It seems like the repository won't close the connection when using block() or blockLast(). In the case of saveAll() many connections are opened but not closed.</p>

<p>Edit: I know this is not really reactive, but I don't want have to chain everything in this class. In case there is no way this could work, I'm happy to see your suggestions. As I said I'm fairly new to this topic.</p>

